import Card from 'react-bootstrap/Card';
import { useParams } from 'react-router-dom';
import { useState, useEffect } from 'react';
import { useAuthContext } from '../hooks/useAuthContext';

const SendDraft = () => {
    const { user } = useAuthContext()
    let { id } = useParams();
    const [meetData,setMeetData] = useState(null)

    useEffect(()=>{
        const fetchMeeting = async () => {
          const response = await fetch('/draft/'+id,{
            headers:{
              'Authorization':`Bearer ${user.token}`
            }
          })
    
          const json = await response.json()
    
          if(response.ok){
            console.log("from MeetData ",json)
            setMeetData(json)
          }
        }
      
    
        if (user) {
            fetchMeeting()
        }
        // setGroupData(groups.filter(group=>group._id===id))
      },[id,user])
    return ( 
        <>
        <div className="container">
                <Card >
                    <Card.Header >{meetData}</Card.Header>
                    <Card.Body>
                    <Card.Text>

                    </Card.Text>
                    </Card.Body>
                </Card> 
        </div>
        </>
     );
}
 
export default SendDraft;
